import { ReactComponent as Js } from './js.svg';
import { ReactComponent as Ts } from './ts.svg';
import { ReactComponent as Redux } from './redux.svg';
import { ReactComponent as Mobx } from './mobx.svg';
import { ReactComponent as React } from './reactjs.svg';
import { ReactComponent as Angular } from './angular.svg';
import { ReactComponent as Vue } from './vue.svg';
import { ReactComponent as Node } from './node.svg';
import { ReactComponent as Postgre } from './postgresql.svg';
import { ReactComponent as Mongo } from './mongo.svg';
import { ReactComponent as Mysql } from './mysql.svg';
import { ReactComponent as Aws } from './aws.svg';
import { ReactComponent as Cl } from './cl.svg';
import { ReactComponent as Flutter } from './flutter.svg';
import { ReactComponent as Fabric } from './fabric.svg';
import { ReactComponent as Fastlane } from './fastlane.svg';
import { ReactComponent as Bitrise } from './bitrise.svg';
import { ReactComponent as Sentry } from './sentry.svg';
import { ReactComponent as Miro } from './miro.svg';
import { ReactComponent as Figma } from './figma.svg';
import { ReactComponent as ProtoPie } from './protoPie.svg';
import { ReactComponent as Maze } from './maze.svg';
import { ReactComponent as Zeplin } from './zeplin.svg';
import { ReactComponent as Analytics } from './analytics.svg';
import { ReactComponent as Hotjar } from './hotjar.svg';
import { ReactComponent as Mixpanel } from './mixpanel.svg';

const WeDoIcons = {
    "ui/ux": [
        { image: Miro,
            text: 'Miro'
        },
        { image: Figma,
            text: 'Figma'
        },
        { image: ProtoPie,
            text: 'ProtoPie'
        },
        { image: Maze,
            text: 'Maze'
        },
        { image: Zeplin,
            text: 'Zeplin'
        },
        { image: Analytics,
            text: 'Analytics'
        },
        { image: Hotjar,
            text: 'Hotjar'
        },
        { image: Mixpanel,
            text: 'Mixpanel'
        },
    ],
    "frontend": [
        { image: Js,
            text: 'JavaScript'
        },
        { image: Ts,
            text: 'TypeScript'
        },
        { image: Redux,
            text: 'Redux'
        },
        { image: Mobx,
            text: 'MobX'
        },
        { image: React,
            text: 'ReactJS'
        },
        { image: Angular,
            text: 'AngularJs'
        },
        { image: Vue,
            text: 'Vue.js'
        },
    ],
    "backend": [
        { image: Node,
            text: 'Node.js'
        },
        { image: Postgre,
            text: 'PostgreSQL'
        },
        { image: Mongo,
            text: 'Mongo'
        },
        { image: Mysql,
            text: 'MySQL'
        },
        { image: Aws,
            text: 'AWS'
        },
        { image: Cl,
            text: 'Cl'
        }
    ],
    "mobile": [
        { image: React,
            text: 'React Native'
        },
        { image: Flutter,
            text: 'Flutter'
        },
        { image: Fabric,
            text: 'Fabric'
        },
        { image: Fastlane,
            text: 'Fastlane'
        },
        { image: Bitrise,
            text: 'BitriseCl'
        },
        { image: Sentry,
            text: 'Sentry'
        }
    ]
}

export default WeDoIcons;
